package Task;

public class DoWhile {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=0;i<=10;i++)
		{
			System.out.println("siddu");
		}
		int j=0;
		while(j<=10)
		{
			System.out.println("chintu");
			j++;
		}
		int a=0;
		do {
			System.out.println("bittu");
		}
		while(a==0);
		
		}

	}

